  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for the Annada
  District of Mark Twain National Wildlife Refuge summarizes Refuge activities during
  the 1998 fiscal year.  Clarence Cannon NWR, the Delair Division, the Gardner Division,
  the Gregory Landing Division, and the Harlow Island Division are included.  The
  report begins with an introduction to the Refuge and a summary of the yearu2019s
  highlights and climatic conditions.  Information about monitoring and studies- including
  surveys and censuses- is provided next.  Habitat restoration and management projects
  are also covered; activities include water level management, moist soil management,
  farming, timber management, and prescribed burning.  Fish and wildlife management
  is discussed next with emphasis on disease monitoring, nest structures, and predator
  control.  Coordination activities, such as private land activities, are outlined.
  \ The resource protection section provides information about land acquisition.  Information
  about public education and recreation is given.  Finally, Refuge planning and administration-
  including comprehensive management planning and general administration- are discussed.\",\n\t\"owner_org\":
